def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def has_digit_5(n):
    while n > 0:
        if n % 10 == -5:
            return True
        n //= 10
    return False

